PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?song ?songLabel ?year ?album WHERE {
  VALUES ?person {
    wd:Q34086
  }
  {
    ?song wdt:P86 ?person .
  } UNION {
    ?song wdt:P676 ?person .
  }
  OPTIONAL {
    ?song rdfs:label ?songLabel .
    FILTER ( LANG( ?songLabel ) = "en" )
  }
  OPTIONAL {
    ?song wdt:P577 ?year .
  }
  OPTIONAL {
    ?song wdt:P178 ?album .
    ?album rdfs:label ?albumLabel .
    FILTER ( LANG( ?albumLabel ) = "en" )
  }
  {
    SELECT ?song ( COUNT( ?contributor ) AS ?contributorCount ) WHERE {
      VALUES ?person {
        wd:Q34086
      }
      ?song wdt:P86 | wdt:P676 ?contributor .
    }
    GROUP BY ?song
  }
  FILTER ( ?contributorCount <= 5 )
}

